// import  React, { useState } from 'react';
import { Link } from 'react-router-dom';   //may or may not need
import FooterButton from '../FooterButton/FooterButton';
import './Footer.css';

function Footer (props) {

  // If coming from the Landing Page, user could be on Input or Results Page 
  if (props.fromLandingPage || props.fromResultPage) {
    console.log('FROM LANDING PAGE');
    return (
      <footer id="app-footer">
        <Link to="/grouper">
          { props.newProject ?
            <FooterButton
                  value={props.value}
                  text="Shuffle"
                  onClick={props.onClickShuffle} /> 
            : 
            <FooterButton
                value={props.value}
                text="Edit"
                onClick={props.onClickEdit} /> 
          }
        </Link>
      </footer>
    )
  }
  // If coming from the Input Page, user is on Result Page
  else if (props.fromInputPage) {
    console.log('FROM INPUT PAGE');
      return(
          <footer id="app-footer">
            <Link to="/grouper">
              { props.saveClicked ?
                <FooterButton
                    value={props.value}
                    text="Edit"
                    onClick={props.onClickEdit} /> 
                :
                <div>
                <FooterButton
                    value={props.value}
                    text="Edit"
                    onClick={props.onClickEdit} /> 
                <FooterButton
                    value={props.value}
                    text="Save"
                    onClick={props.onClickSave} />
                </div>
              }
            </Link>
          </footer>
      )
  }
}


export default Footer;
